                    value='No description here!'
                    required 
                    multiline 
                    minRows={3} 
                    onChange={e=>setDescription(e.target.value)}
                    />
                </Grid>
                <Grid item>
                    <Button variant='contained'>Create Task</Button>
                </Grid>
            </Grid>
        </form>
    )
}

export default ProfilePanel;
